function extractConsumptionData(apiResponse) {
  const monthNames = [
    "Jan",
    "Feb",
    "Mar",
    "Apr",
    "May",
    "Jun",
    "Jul",
    "Aug",
    "Sep",
    "Oct",
    "Nov",
    "Dec",
  ];

  const extractedData = [];

  // Process each consumption record
  apiResponse.consumptions.forEach((record) => {
    const date = new Date(record.time);

    const extractedRecord = {
      year: date.getFullYear(),
      month: monthNames[date.getMonth()],
      value: record.value,
    };

    extractedData.push(extractedRecord);
  });

  return extractedData;
}

