let { year, month, activityName, startDate, endDate } = runtime.inputs();
let collections = lucy.currentModel().collections();

let filters = { "$and": [] };

// Add filters conditionally
if (year) {
    filters["$and"].push({ year: year });
}
if (month) {
    filters["$and"].push({ month: month });
}
if (activityName) {
    filters["$and"].push({
        activityName: {
            "$regex": activityName,
            "$options": "i"  // case-insensitive
        }
    });
}
if (startDate && endDate) {
    filters["$and"].push({
        date: {
            "$gte": new Date(startDate),
            "$lte": new Date(endDate)
        }
    });
}

// Clean up empty $and if needed
if (filters["$and"].length === 0) {
    delete filters["$and"];
}

// Query the collection
collections.findMany('carbon_reporting_80rr', filters, {})
    .then(res => runtime.done({ filteredData: res }))
    .catch(e => runtime.error(e));
